Update Many if exists , otherwise create for each LeadId that doesn't exists a new Document<p>Consider the Schema : </p>

<pre><code>const mongoose = require("mongoose");
const Schema = mongoose.Schema;
const EightWeekGamePlanSchema = new Schema({
  Week: {
    type: Number,
    required: true
  },
  LeadId: {
    type: String,
    required: true
  },
  PackageId: {
    type: String,
    required: true
  },
  BusinessName: {
    type: String,
    required: true
  },
  PhoneNumberMasque: {
    type: String,
    required: true
  },
  City: {
    type: String,
    required: true
  },
  Rooms: {
    type: Number,
    required: true
  },
  LeadStartDate: {
    type: Date
  },
  LeadEndDate: {
    type: Date
  },

  TargetedToBeClaimedByClientType: {
    type: Number,
    required: true
  },
  TotalClaimsLeftToBeClaimedByClientType: {
    // incresed by 1 every time it's claimed
    type: Number,
    required: true
  },
  TotalClaimsToBeClaimedByClientType: {
    // Stays fixed
    type: Number,
    required: true
  },
  Status: {
    type: Number,
    required: true
  },

  InsertDate: {
    type: Date,
    default: Date.now
  }
});

module.exports = EightWeekGamePlan = mongoose.model(
  "eightweekgameplan",
  EightWeekGamePlanSchema
);
</code></pre>

<p>I'm trying the write a pretty complex query : updates multiple documents by given number in <code>howManyClaims</code> , if their <code>LeadID</code> appears in a given array <code>winnerLeads</code> AND their <code>TargetedToBeClaimedByClientType</code> property equals the given <code>groupTarget</code> : </p>

<pre><code>router.post("/add-claims-to-group", auth, async (req, res) =&gt; {
    const { howManyClaims, groupTarget, winnerLeads, week } = req.body;
    EightWeekGamePlan.updateMany(
        {
          LeadId: {
            $in: winnerLeads
          },
          TargetedToBeClaimedByClientType: groupTarget
        },
        { $inc: { TotalClaimsToBeClaimedByClientType: howManyClaims } },
        { multi: true },
        (err, writeResult) =&gt; {
          if (err) {
            console.log(err);
          } else {
            console.log(writeResult);
          }
        }
      );
}
</code></pre>

<p>Otherwise , do some kind of a <code>Create</code> : take one of the existing <code>EightWeekGamePlan</code> documents that belong to the <code>LeadID</code> , duplicate it and set its <code>TotalClaimsToBeClaimedByClientType</code> property with <code>howManyClaims</code>.</p>

<p>Is it possible to combine both Update and Create actions in one query ? </p>

