How to perform aggregations in Go using mongo-driver<p>I have a MongoDB collection with 3 fields:</p>

<pre><code>_id: ObjectId
field1: Number
field2: Number
</code></pre>

<p>I am doing this aggregation to get "distinct" field1/field2 rows and doing a total count of the results. This works OK in the client (Robo3t):</p>

<pre><code>db.mycollection.aggregate([
    {
        $group: { 
            _id: { field1: "$field1", field2: "$field2" },
        }
    },
    { 
        $group: { 
            _id: null, count: { $sum: 1 } 
        } 
    }
])
</code></pre>

<p>Result:</p>

<pre><code>{
    "_id" : null,
    "count" : 57.0
}
</code></pre>

<p><strong>How could I do this aggregation in Go using <a href="https://godoc.org/go.mongodb.org/mongo-driver/mongo" rel="nofollow noreferrer">mongo-driver</a>?</strong></p>

<p>There is <a href="https://godoc.org/go.mongodb.org/mongo-driver/mongo#Collection.Aggregate" rel="nofollow noreferrer">this</a> method to perform aggregations but the documentation is not clear to me. I understand that I should do some kind of bson query but I don't know where to start.</p>

